#vdLcommission

text:
@matteorenzi Grazie Matteo.
È stato molto importante che questa legge sia stata votata all'unanimità anche al Senato.
Adesso con la stessa compattezza dobbiamo impegnarci per i decreti attuativi, che saranno braccia e gambe di una legge che può aiutare più di 3mln di cittadini con disabilità.

Il decreto #PNRR ci mette di fronte alla sfida di essere competitivi e combattere le diseguaglianze. Al centro del nostro impegno: semplificazione amministrativa, sostegno a turismo, imprese, lavoratori, digitale, sanità.

@BeaLorenzin

